function Generar_obstaculos () {
    for (let index = 0; index < nivel; index++) {
        for (let index = 0; index <= y.length - 1; index++) {
            Genera_coches()
            tiles.placeOnRandomTile(obstaculo, sprites.vehicle.roadHorizontal)
            x = randint(0, 3200)
            obstaculo.setPosition(x, y[index])
        }
    }
}
